Total Training for Adobe Premiere Pro CS5 

With Total Training for Adobe Premiere Pro CS5 youll learn how to edit to deliver your most professional productions--on time and on budget. See why this truly ground-breaking toolset makes it easier than ever for you to transform your video into compelling stories that will stand out ahead of your competition.

Highlights

   Learn how to create sequences
   Master capturing video from tape
   Add transitions &amp; keyframes
   Discover how to export your work in the proper format
   Cover new features like the Speech to text workflow
   Expand native tapeless workflows (using the Media browser)
   Explore the New Sequence Presets

